import { Container, Grid,Paper,Box, Typography} from '@mui/material';
import React from 'react';
import { styled } from '@mui/material/styles';
import doctor from '../../../images/doctor.png';
import bg from '../../../images/appointment-bg.png';

import { green } from '@mui/material/colors';
import { dark } from '@mui/material/styles/createPalette';
// import Paper from '@mui/material/Paper';



const AppointmentBanner = () => {
  const AppointmentBannerBg={
    backgroundColor: 'green',
    backgroundImage: `url(${bg})`
    }
    return (
        <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2} style={AppointmentBannerBg}>
        <Grid item xs={12} md={6}>
          <img style={{
            width:400
          }} src={doctor} alt="" />
        </Grid>
        <Grid item xs={12} md={6}>
          <Typography variant={green}> Appoinment </Typography>
          <Typography variant={dark}> Appoinment </Typography>
          <Typography variant={grey}> Appoinment </Typography>
        </Grid>
      </Grid>
    </Box>
    );
};

export default AppointmentBanner;
